  //         <Route path="/main" component={Main} /> {/* Example main route */}
  //         {/* Other routes */}
  //     </Router>
  //   );
  return (
    <div className="App" style={{ backgroundColor: "#d4cccc" }}>
      <Route path="/" component={LoginPage} exact />
      <Route path="/home">
        {/* Components rendered for '/home' */}
        <Navbar />
        <Home />
        <Main />
        <Footer />
      </Route>
    </div>
  );
};

export default App;
